		"com/evorait/evoplan/i18n/i18n_en.properties": "# Fiori Reference Application Approve Work Orders based on Enterprise Procurement Model\r\n# __ldi.translation.uuid=18d0c7d0-b8fd-11e4-9f5c-0800200c9a66\r\n\r\nappTitle=EvoPlan\r\nappDescription=\r\n\r\n#XTIT: Title of the shell, displayed above the application when it is active\r\nshellTitle=evoPlan\r\n#XTIT: Shell subtitle\r\nshellSubTitle=\r\n#XTIT: Title for a tile\r\nxtit.tileTitle=evoPlan\r\n#XTOL: Tooltip for share button\r\nxtol.share=Share\r\n#XBUT: Email Button\r\nxbut.email=Send Email\r\n#XTIT: Subject for an email\r\nxtit.emailSubject=Approval of Demand {0}\r\n#XTIT: Content for an email\r\nxtit.emailContent=Please check Demand {0} for technician {1}\r\n\r\n\r\n#XBUT: OK button\r\nxbut.buttonOK=OK\r\n#XBUT: Cancel button\r\nxbut.buttonCancel=Cancel\r\n\r\n#~~~ Master View ~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Title for the master section while no count is available\r\nmasterTitle=Technician\r\n#XTIT: Title for the master section\r\nmasterTitleCount=Technician ({0})\r\n#XFLD: Prefix to ordered-by attribute\r\nxfld.orderedBy=Ordered by {0}\r\n#XFLD: Number of items\r\nxfld.items={0} Items\r\n#XFLD: Exactly one item\r\nxfld.item=1 Item\r\n#XBLI: text for a list with no data\r\nmasterListNoDataText=No technicians available\r\n#XBLI: text for a list with no data with filter or search\r\nmasterListNoDataWithFilterOrSearchText=No matching resource group or technician found\r\n#XTIT: Title of the General Information form\r\nxtit.formTitle=General Information\r\n#XTIT: Title of the details section\r\ndetailTitle=Demands\r\n#XTIT: Title of item list while loading\r\nxtit.itemListTitle=Demands\r\n#XTIT: Title of item list when count is known\r\nxtit.itemListTitleCount=Demands ({0})\r\n#XTIT:\r\nxtit.tableObject=Description\r\nxtit.tableAssignment=Assigned\r\nxtit.tableWorkload=Workload\r\nxtit.tableCheckbox=ResourceCheckbox\r\n\r\n#~~~ Order table view ~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XBUT\r\nxbut.changeStatus=Change Status\r\n#XBUT\r\nxbut.assign=Assign\r\n#XBUT\r\nxbut.showPlanningCal=Planning Calendar\r\n#YMSG\r\nymsg.selectMinItem=Please select at least one item from demands table.\r\n\r\n#~~~ Error Handling ~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Error dialog title\r\nerrorTitle=Error \r\n#YMSG: Error dialog description\r\nerrorText=Sorry, a technical error occured! Please try again later\r\n\r\n\r\n#~~~ Not Found View ~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Not found view title\r\nnotFoundTitle=Not Found\r\n\r\n#XTIT: Not found table data\r\ntableNoDataText=No {0} found\r\n\r\n#YMSG: The object not found text is displayed when there is no object with this id\r\nnoObjectFoundText=This item is not available\r\n\r\n#YMSG: The objects not available text is displayed when there is no data when starting the app\r\nnoObjectsAvailableText=No item are currently available\r\n\r\n#YMSG: The not found text is displayed when there was an error loading the resource (404 error)\r\nnotFoundText=The requested resource was not found\r\n\r\n#XFLD: Keyword for FLP tile configuration\r\nxfld.keyWord1=Plan orders for technicians\r\n#XFLD: Keyword for FLP tile configuration\r\nxfld.keyWord2=Dispatch orders\r\n\r\n#~~~ Fragments ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT filter view title\r\nxtit.filterTitleView=View\r\n\r\n#XTIT filter view group\r\nxtit.filterTitleGroup=Resource Group\r\n\r\n#XTIT filter view date range\r\nxtit.filterTitleDateRange=Date Range\r\n\r\nxtit.filterDateFrom=Date from\r\nxtit.filterDateTo=Date to\r\n\r\ndateFormat=yyyy-MM-dd\r\n\r\n#XTIT assign modal title\r\nxtit.assignModalTitle=Assign to user or group\r\n\r\n#XTIT planning calendar modal title\r\nxtit.calendarModalTitle=Resource Planning Calendar",
